import './header.css';
import React from 'react';


class Jumbo extends React.Component {
render() {
    return (
           <div>
               <div>
                   <h1>
                    Welcome To J&J Media
                   </h1>
                   <h2>
                    Everyone has a story, and we wish to capture it!
                   </h2>
                   <a class="btn btn-success js-scroll-trigger" href="#about">Get Started</a>
               </div>
           </div>
    );
  }
}

export default Jumbo;
